import React from "react";
import { Button } from "react-bootstrap";

export default function Footer(){
    return(
        <div className="footer">
            <Button>Como funciona?</Button>
            <Button>Quienes somos?</Button>
            <Button>Medios de pago</Button>
        </div>
    )
}
